sys_variable_value.value:
(function execute(inputs, outputs) {
    var pubSub = new GooglePubsubUtils();
    pubSub.validateInputVariables(inputs, outputs);
    pubSub.validateMandatoryVariables(inputs, ["projectid", "snapshot"]);
    pubSub.maptoOutputFromInput(inputs, outputs, ["projectid", "snapshot"]);
    var payload = {
        "snapshot": {},
        "updateMask": "labels"
    }
    var labels = pubSub.arrayObjecttoObject(inputs.labels);
    if (!labels)
        throw new Error("Labels should be mandatory");
    payload["snapshot"]["labels"] = labels;
    outputs.payload = JSON.stringify(payload);
})(inputs, outputs);

